    render() {
    let cvData = this.props.cvData;
    return (
        <footer>
        <div className="row">
        <div className="twelve columns">
            <ul className="social-links">
            {
                cvData.socialLinks && cvData.socialLinks.map((item)=>{
                return(
                    <li>
                    <a href={item.url}>
                    <i className={item.className} />
                    </a>
                    </li>
                )
                })
            }
            </ul>
            <ul className="copyright">
